using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace AMaisImob_WEB.Utils
{
    public static class CertificateUtils
    {
        public static bool IsInTimeToRenovate(this DateTime? me)
        {
            if (!me.HasValue) return false;

            var date = me.Value;
            var startDate = new DateTime(date.AddMonths(12).Year, date.AddMonths(12).Month, 1);// inicio da data de renovação
            var daysInMonth = DateTime.DaysInMonth(startDate.Year, startDate.Month);
            var endDate = new DateTime(startDate.Year, startDate.Month, daysInMonth, 23, 59, 59); // data final de renovação

            return startDate <= DateTime.Now && endDate >= DateTime.Now;
        }
        public static bool IsActive(this DateTime? me, DateTime? refDate = null)
        {
            if (!me.HasValue) return false;

            if (refDate == null) refDate = DateTime.Now;

            var date = me.Value;
            var firstDayOfRenovation = new DateTime(date.Year, date.Month, 1).AddMonths(12);// inicio da data de renovação

            return firstDayOfRenovation > refDate;
        }

        public static bool IsInTimeToRenovate(this DateTime me)
        {
            var startDate = new DateTime(me.AddMonths(12).Year, me.AddMonths(12).Month, 1);// inicio da data de renovação
            var daysInMonth = DateTime.DaysInMonth(startDate.Year, startDate.Month);
            var endDate = new DateTime(startDate.Year, startDate.Month, daysInMonth, 23, 59, 59); // data final de renovação

            return startDate <= DateTime.Now && endDate >= DateTime.Now;
        }

